import './App.css';
import React, { useState, useEffect } from 'react';
import clsx from 'clsx';

import { makeStyles } from '@material-ui/core/styles';
import CssBaseline from '@material-ui/core/CssBaseline';

import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';

import Table from './Table';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

function preventDefault(event) {
  event.preventDefault();
}

const useStyles = makeStyles((theme) => ({
  content: {
    flexGrow: 1,
    height: '100vh',
    overflow: 'auto',
  },

  container: {
    paddingTop: theme.spacing(4),
    paddingBottom: theme.spacing(4),
  },

  fixedHeightHead: {
    height: 100,
  },

  fixedHeightTable: {
    height: 100,
  },


}));

function App() {
  const classes = useStyles();
  const fixedHeightPaperTable = clsx(classes.paper, classes.fixedHeightTable);
  return (
    <div>
      <CssBaseline />
      <main className={classes.content}>
      <Container maxWidth="lg" className={classes.container}>

            <h2>Management</h2>
            <h1>Client</h1>
      <form noValidate autoComplete="off">
        <TextField id="outlined-basic" label="Search" variant="outlined" size="small" />
        <Button variant="outlined" color="primary">SEARCH</Button>
        <Button variant="outlined" color="primary">CLEAR</Button>
      </form>

      <Grid container spacing={3}>
        <Grid item xs={12} md={8} lg={9}>
          <Paper className={fixedHeightPaperTable}>
            {/* Table.js, API data fetching and displaying */}
            <Table />  
          </Paper>
        </Grid>
      </Grid>
      </Container>
      </main>
    </div>
  );
}

export default App;
